cy.get('.wall').then(function ($wall) {
  cy.get('.spider').should(function ($spider) {
    var spiderLeft = $spider.offset().left;
    var expectedLeft = $wall.innerWidth() / 2 + ($wall.offset().left + 10) - $spider.width() / 2;
    expect(spiderLeft).to.equal(expectedLeft);
  });
});

cy.get('.wall').then(function ($wall) {
  cy.get('.spider').should(function ($spider) {
    var spiderTop = $spider.offset().top;
    var expectedTopAbs = $wall.innerHeight() / 2 + ($wall.offset().top + 10) - $spider.height() / 2;
    expect(spiderTop).to.equal(expectedTopAbs);
  });
});
